import React, {Component} from "react";
class Name extends React.Component {
	render() {
		const { value } = this.props;
		return (
		 <div className="form">
         <label htmlFor="name">FirstName</label>
         <input type="text" name="fname" id="name" MaxLength="10" onBlur={this.input_blur(value)}/>
         <label htmlFor="name">LastName</label>
         <input type="text" name="lname" id="name" MaxLength="10" onBlur={this.input_blur(value)}/>

       </div>
		)
	}
}
export default Name;
